import React, { useState,useEffect,useCallback} from "react";
import cardimage from "./Images/1.jpeg"
import './App.css';

function App() {
  const [number,setNumber]= useState('');
  const [name,setName]= useState('');
  const [month,setMonth]= useState('');
  const [year,setYear]= useState('');
  const [cvv,setCvv] = useState('');
  const [focus,setFocus]= useState('');

  return (
    <div className="App">
 <div className="creditcard" >
 <div ></div>
 <span style={{'color':'white'}}>{number}</span>
 <br></br>
   <span style={{'color':'white'}}>{name}</span>
   <br></br>
   <span style={{'color':'white'}}>{month}</span>/<span style={{'color':'white'}}>{year}</span>
   <br></br>
   <span style={{'color':'white'}}>{cvv}</span>
 </div>

 <div className = "carddetails">
 <label style={{'marginRight':'79%'}}>Card Number</label>
 <br></br>
          <input
          style={{'width':'100%'}}
          id="cardnumber"
            type="tel"
            name="number"
            value = {number} 
            onChange = {e=> setNumber(e.target.value)}
          />
        <br></br>
        <label style={{'marginRight':'82%'}}>Card Name</label>
        <br></br>
          <input
            style={{'width':'100%'}}
          id ="cardname"
            type="text"
            name="name"

            value = {name}
            onChange = {e=> setName(e.target.value)}
          />
           <br></br>
           <label style={{'marginRight':'70%'}}>Expiration Date</label>
           <label>Cvv</label>
           <br></br>
          <input
          style={{'width':'110px'}}
          id = "month"
            type="number"
            name="number"
            placeholder="Month"
            min = "1"
            max = "12"
            value = {month}
            onChange = {e=> setMonth(e.target.value)}
          />

          <input
          style={{'width':'110px'}}
          id = "year"
            type="number"
            name="number"
            placeholder="Year"
            min = "2021"
            max ="2040"
            value = {year}
            onChange = {e=> setYear(e.target.value)}

          />

          <input
          style={{'width':'237px'}}
          id = "cvv"
            type="tel"
            name="number"
            value = {cvv}
            onChange = {e=> setCvv(e.target.value)}

          />
          <br></br>
          <button>Submit</button>
 </div>
</div>
  );
}

export default App;
